def min_cost(cost, m, n):
    # Initialize a 2D array to store the minimum cost to reach each cell
    min_cost_matrix = [[0 for _ in range(n + 1)] for _ in range(m + 1)]

    # Fill the first row and first column with the values from the cost matrix
    for i in range(1, m + 1):
        min_cost_matrix[i][0] = cost[i - 1][0]
    for j in range(1, n + 1):
        min_cost_matrix[0][j] = cost[0][j - 1]

    # Calculate the minimum cost to reach each cell
    for i in range(1, m + 1):
        for j in range(1, n + 1):
            min_cost_matrix[i][j] = cost[i - 1][j - 1] + min(min_cost_matrix[i - 1][j], min_cost_matrix[i][j - 1])

    # Return the minimum cost to reach (m, n)
    return min_cost_matrix[m][n]

