def count_no_of_ways(n, k):
    """
    Finds the number of ways of painting a fence with n posts and k colors such that at most 2 adjacent posts have the same color.

    Args:
    n: The number of posts in the fence.
    k: The number of colors available.

    Returns:
    The number of ways of painting the fence.
    """

    # Base cases
    if n == 1:
        return k
    if n == 2:
        return k * k

    # Initialize the dp array
    dp = [[0 for _ in range(k)] for _ in range(n)]

    # Fill the dp array
    for i in range(k):
        dp[0][i] = 1
    for i in range(1, n):
        for j in range(k):
            for l in range(k):
                if j != l:
                    dp[i][j] += dp[i - 1][l]

    # Return the sum of the last row of the dp array
    return sum(dp[n - 1])

