def find_ways(n):
    """Counts the number of sequences of length n having non-negative prefix sums that can be generated by values 1, 2, and 3."""
    # Initialize the dp array to store the number of ways to generate sequences of length i with non-negative prefix sums.
    dp = [0] * (n + 1)

    # Base case: There is only one way to generate a sequence of length 0 with a non-negative prefix sum.
    dp[0] = 1

    # Iterate over the length of the sequences.
    for i in range(1, n + 1):
        # For each length, consider all possible values (1, 2, and 3) that can be added to the previous sequence.
        for j in range(1, 4):
            # If adding the current value j to the previous sequence results in a non-negative prefix sum, increment the count of ways.
            if i - j >= 0:
                dp[i] += dp[i - j]

    # Return the number of ways to generate sequences of length n with non-negative prefix sums.
    return dp[n]

