def find_Min_Swaps(arr, n):
    # Count the number of 0s and 1s
    count0 = 0
    count1 = 0
    for i in range(n):
        if arr[i] == 0:
            count0 += 1
        else:
            count1 += 1

    # If the number of 0s and 1s is not equal, then the array cannot be sorted
    if count0 != count1:
        return -1

    # Count the number of 0s on the left side of the array
    left_count0 = 0
    for i in range(n):
        if arr[i] == 0:
            left_count0 += 1

    # Count the number of 1s on the right side of the array
    right_count1 = 0
    for i in range(n - 1, -1, -1):
        if arr[i] == 1:
            right_count1 += 1

    # The minimum number of swaps required is the sum of left_count0 and right_count1
    return left_count0 + right_count1

